import Visuals from './Visuals';
import LoginInput from './LoginInput';

function App()
{
  

  
  

  return(
    <div>

  <LoginInput/>

    {/* Pass state and handleSubmit function as props to Visuals */}
    <Visuals 
      username={LoginInput.username} 
      setUsername={LoginInput.setUsername}
      password={LoginInput.password} 
      setPassword={LoginInput.setPassword} 
      responseMessage={LoginInput.responseMessage} 
    />
  </div>
  );
}



export default App;
